import React from 'react';
import CompanyCard from './CompanyCard';
import { Container, Row } from 'reactstrap'

const CompanyList = ({ companies }) => {
  return (
    <Container>
      <Row className="my-3">
        {companies.map(company => <CompanyCard company={company} />)}
      </Row>
    </Container>
  )
};

export default CompanyList;
